import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Grid,Button, Typography,Box,Container} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  backgroundFix: {
    minHeight: '500px',
    width: '100%',
    backgroundColor: 'black',
    zIndex: 2,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    clipPath: "polygon(100% 0, 100% 70%, 80% 100%, 0 70%, 0 0)",
  },
  centerTitleContainer: {
    position: 'absolute',
    top: 0,
    right: 0,
    left: 0,
    width: '100%',
    height: '100%',
    backgroundColor: 'transparent',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center'
  },
  centerTitle: {
    fontSize: '30px',
    color: 'white',
    letterSpacing: '.2em',
    fontWeight: 500,
    margin: 0,
    //width: 'max-content',
    textAlign: 'center',
    //backgroundColor: 'blue',
    textTransform: 'uppercase',
    fontFamily: 'Raleway, sans-serif',
    ['@media (max-width:780px)']: {
      fontSize: '20px',

  },
  },
  gridContainer: {
    //backgroundColor: 'blue',
    display: 'flex',
    alignItems: 'center',
    marginBottom: 50,
    marginTop: 100
  },
  text: {
    fontSize: '16px',
    fontWeight: 400,
    lineHeight: '2rem',
    color: 'blak',
    fontFamily: 'Open Sans, sans-serif'
  },
  title: {
    fontFamily: 'Noto Sans JP, sans-serif',
    fontSize: '35px',
    fontWeight: 500,
    color: '#333333',
    margin: '30px 0'
  },
  list: {
    paddingLeft: 35,
    display: 'flex',
    flexDirection: 'column',
    listStyleType: 'disc',
    '& li': {
      display: 'list-item',
      fontSize: '16px',
      fontWeight: 400,
      lineHeight: '2rem',
      color: 'blak',
      marginTop: 10,
      fontFamily: 'Open Sans, sans-serif'
    }
  }
}));

const items = [
    {
        id: 1,
        title: '300',
    },
    {
        id: 2,
        title: '400',
    },
    {
        id: 3,
        title: '500',
    },
    {
        id: 4,
        title: '600',
    }
]
const Terms = () => {
  const classes = useStyles();

  return (
    <div>
      <Grid container xs={12} className={classes.backgroundFix}>
        <h1 className={classes.centerTitle}>Terms And Conditions</h1>
      </Grid>
      <Container maxWidth="md" style={{ marginBottom: 200 }}>
        <Grid container xs={12} className={classes.gridContainer}>
          <Box>
            <Typography className={classes.title}>Terms of Use of FreePrivacyPolicy.com</Typography>
            <Typography className={classes.text}>Please read these terms and conditions carefully before using Our Service.</Typography>
            <Typography className={classes.title}>Interpretation and Definitions</Typography>
            <Typography className={classes.title}>Interpretation</Typography>
            <Typography className={classes.text}>The words of which the initial letter is capitalized have meanings defined underthe following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</Typography>
            <Typography className={classes.title}>Definitions</Typography>
            <Typography className={classes.text}>For the purposes of these Terms and Conditions:</Typography>
            <ul className={classes.list}>
              <li>Affiliate means an entity that controls, is controlled by or is under common control with a party, where "control" means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.</li>
              <li>Account means a unique account created for You to access our Service or parts of our Service.</li>
              <li>Company (referred to as either "the Company", "We", "Us" or "Our" in this Agreement) refers to FreePrivacyPolicy.com website.</li>
              <li>Country refers to: Romania</li>
              <li>Device means any device that can access the Service such as a computer, a cellphone or a digital tablet.</li>
              <li>Feedback means feedback, innovations or suggestions sent by You regarding the attributes, performance or features of our Service.</li>
              <li>Products refer to the products or items offered for sale on the Service.</li>
              <li>Orders mean a request by You to purchase Products from Us.</li>
              <li>Promotions refer to contests, sweepstakes or other promotions offered through the Service.</li>
              <li>Service refers to the Website.</li>
              <li>Terms and Conditions (also referred as "Terms" or "Terms of Use") mean these Terms and Conditions that form the entire agreement between You and the Company regarding the use of the Service.</li>
              <li>Third-party Social Media Service means any services or content (including data, information, products or services) provided by a third-party that may be displayed, included or made available by the Service.</li>
              <li>Website refers to FreePrivacyPolicy.com, accessible from https://www.freeprivacypolicy.com</li>
              <li>You means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</li>
            </ul>
            <Typography className={classes.title}>Acknowledgment</Typography>
            <Typography className={classes.text}>These are the Terms and Conditions governing the use of this Service and the agreement that operates between You and the Company. These Terms and Conditions set out the rights and obligations of all users regarding the use of the Service.</Typography>
            <Typography className={classes.text}>Your access to and use of the Service is conditioned on Your acceptance of and compliance with these Terms and Conditions. These Terms and Conditions apply to all visitors, users and others who access or use the Service.</Typography>
            <Typography className={classes.text}>By accessing or using the Service You agree to be bound by these Terms and Conditions. If You disagree with any part of these Terms and Conditions then You may not access the Service.</Typography>
            <Typography className={classes.text}>You represent that you are over the age of 18. The Company does not permit those under 18 to use the Service.</Typography>
            <Typography className={classes.text}>Your access to and use of the Service is also conditioned on Your acceptance of and compliance with the Privacy Policy of the Company. Our Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your personal information when You use the Application or the Website and tells You about Your privacy rights and how the law protects You. Please read Our Privacy Policy carefully before using Our Service.</Typography>
            <Typography className={classes.title}>Legal Advice Disclaimer for Our Products</Typography>
            <Typography className={classes.text}>You understand that we offer legal contracts, policies or agreements ("Products"), as created and/or verified by attorneys or paralegals for sale through our Service. You acknowledge that We are not attorneys or paralegals nor do We offer legal advice. You acknowledge that We do not endorse any specific attorney or paralegal or any Product as being better than another. We do not otherwise guarantee the legal accuracy or applicability of any Product for your legal needs. You will at all times look to any attorney or paralegal that you select for services as to any legal claims related to such services.</Typography>
            <Typography className={classes.text}>You understand that it is your responsibility to ensure that the privacy policy or any other policies you create with us is complete, accurate, and meets your companies specific privacy needs.</Typography>
            <Typography className={classes.text}>We are not liable or responsible for any privacy policies or any other policies created using our services, and we give no representations or warranties, express or implied, that the privacy policies or any other policies created using our service are complete, accurate or free from errors or omissions.</Typography>
            <Typography className={classes.title}>Placing Orders for Products</Typography>
            <Typography className={classes.text}>By placing an Order for Products through the Service, You warrant that You are legally capable of entering into binding contracts.</Typography>

          </Box>
        </Grid>
      </Container>
    </div>
  );
};

export default Terms;
